import React from "react";
import ChefCard from "../../../Cards/ChefCard/ChefCard";
import "./ChefOfTheWeek.css";
interface IChefOfTheWeek {
  img: string;
  name: string;
  abutMe: string;
}
const ChefOfTheWeek: React.FC<IChefOfTheWeek> = (props) => {
  return (
    <div className="ChefOfTheWeek">
      <h2>Chef of the week:</h2>
      <div>
        <ChefCard img={props.img} name={props.name} />
        <p>{props.abutMe}</p>
      </div>
    </div>
  );
};
export default ChefOfTheWeek;
